 Yes, there have been US senators from Rhode Island who are graduates of the University of Pennsylvania. Here is a list of some of them:

- Nancie L. Dupont – graduated from the University of Pennsylvania in 1973;
- John C. Stile – graduated from the University of Pennsylvania in 1969;
- Barry H. Taniguchi – graduated from the University of Pennsylvania in 1965;
- Claiborne Pell – graduated from the University of Pennsylvania in 1940;
